export const distance3=(r,e)=>Math.hypot(r[0]-e[0],r[1]-e[1],r[2]-e[2]);export const trimPrefix=(r,e)=>(r.startsWith(e)?r.slice(e.length):r).trim();export const makeTd=r=>{const e=document.createElement("td");e.textContent=e.title=r;return e};export function addRow(r,e){while(r.childElementCount>=listLength){r.lastElementChild.remove()}r.prepend(e)}export function whatGame(r){try{const e=r.header.gameversion;if(e&&(e.startsWith("CAPI-Legacy-")||parseInt(e)<4)){return"Legacy"}const n=r.message;return n.odyssey?"Odyssey":n.horizons?"Horizons":n.horizons===false?"Base":"Unknown"}catch(r){console.log("gameversion error:",r);return"Unknown"}}export const GalacticRegions=["Null","Galactic Centre","Empyrean Straits","Ryker's Hope","Odin's Hold","Norma Arm","Arcadian Stream","Izanami","Inner Orion-Perseus Conflux","Inner Scutum-Centaurus Arm","Norma Expanse","Trojan Belt","The Veils","Newton's Vault","The Conduit","Outer Orion-Perseus Conflux","Orion-Cygnus Arm","Temple","Inner Orion Spur","Hawking's Gap","Dryman's Point","Sagittarius-Carina Arm","Mare Somnia","Acheron","Formorian Frontier","Hieronymus Delta","Outer Scutum-Centaurus Arm","Outer Arm","Aquila's Halo","Errant Marches","Perseus Arm","Formidine Rift","Vulcan Gate","Elysian Shore","Sanguineous Rim","Outer Orion Spur","Achilles's Altar","Xibalba","Lyra's Song","Tenebrae","The Abyss","Kepler's Crest","The Void"];
